import Itemdisplay from "../../molecules/Itemdisplay";
import { useParams } from "react-router-dom";



const Itemdetail = ({mobiledata},{incrementFun})=>{
   
    // const mobileId = match.params.id;
    const  id= useParams().id;
    console.log("itemdet",{incrementFun});
    return (
        <div>
          
       
            <Itemdisplay mobId = {id} incrFunc={incrementFun} mobdata={mobiledata}/>
        </div>
        
    )
}
export default Itemdetail;
